import { Container, Stack, Table, TableHead, TableCell, TableBody,TableRow, TableContainer, Paper } from "@mui/material";
import { Images } from "../../Constants/images";
import { useEffect } from "react";
import { useAuthContext } from '../../hooks/useAuthContext'
const SeeBooking = () => {
    const { user } = useAuthContext();
    useEffect(() => {
        fetch(`http://localhost:4000/getBooking/${user.Email}`,{
            headers:{
                "Authorization" : `Bearer ${user.token}`
            },
            method:"POST"
        })
        .then((res) => {
            return res.json();
        }).then((data) => {
            console.log(data);
        })
    },[]) 
  return (
    <div
      style={{
        backgroundImage: `url(${Images.BG3})`,
        backgroundSize: "cover",
        height: "100vh",
        width: "100%",
      }}
    >
      <Container maxWidth={"lg"}>
        <div>
            <Stack>
                <div className="p-[50px]">
                    <h1 className="text-center font-google text-4xl">View the Booking Below</h1>
                </div>
                <div>
                <TableContainer component={Paper}>
                    <Table>
                        <TableHead>
                            <TableCell>User Name</TableCell>
                            <TableCell>User Email</TableCell>
                            <TableCell>User PhoneNumber</TableCell>
                            <TableCell>House Image</TableCell>
                            <TableCell>From Date</TableCell>
                            <TableCell>To Date</TableCell>
                        </TableHead>
                        <TableBody>
                           {
                            
                           }
                        </TableBody>
                    </Table>
                    </TableContainer>
                </div>
            </Stack>
        </div>
      </Container>
    </div>
  );
};

export default SeeBooking;
